import React from 'react';

const YourOrderPage = () => {
  // Apply the same image style as in EventsPage
  const imageStyle = {
    position: 'absolute',
    top: 30,
    left: 0,
    width: '100%',
    height: '64.9%',
  };

  return (
    <div>
      {/* Replace "Home12.png" with the correct path to your image */}
      <img src="/Home12.png" alt="Home" style={imageStyle} />
      <div>This is the Order Confirmation Page</div>
    </div>
  );
};

export default YourOrderPage;
